import './Home.sass';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Input from '@material-ui/core/Input';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
class Home extends Component {

    render() {
        return (
            <div className={'Home-container'}>
                <Grid container direction={"column"} alignItems={"center"}>
                    <Grid item xs={10} lg={6} md={8} sm={8}>
                        <Card>
                            <CardContent>
                                <Grid container justify={"flex-start"} direction={"row"} spacing={16}>
                                    <Grid item>
                                        <Input placeholder="Name"/>
                                    </Grid>
                                    <Grid item className={'smallInput'}>
                                        <Input
                                            placeholder="Count"/>
                                    </Grid>
                                    <Grid item className={'smallInput'}>
                                        <Input
                                            placeholder="Cost"/>
                                    </Grid>
                                    <Grid item>
                                        <Button size="middle" color="primary" variant="contained">Add</Button>
                                    </Grid>

                                </Grid>
                            </CardContent>
                        </Card>
                    </Grid>
                    <Grid item xs={10} lg={'auto'}>
                        <Card>
                            <CardContent>
                                asd
                            </CardContent>
                        </Card>
                    </Grid>
                </Grid>
            </div>
        );
    }
}
export default Home;
